import React, { Fragment } from 'react';

const HomeArticle = () => {

    return (
        <Fragment>
            <div>
               <h1 style={hading}>কিভাবে ফুলস্টিক ডেভেলপার হওয়া যায় এবং ফুলস্টিক ডেভেলপার হতে গেলে কি কি শিখতে হবে,</h1>
            </div>
        </Fragment>
    )
}
export default HomeArticle;



const hading = {
    color: 'black',
    fontSize: '30px',
    textAlign: 'center'
}
